    //#region -------------------- Singleton usage --------------------

    private static volatile @Nullable EmptyCollectionHolder<?> instance;

    protected EmptyCollectionHolder() { super(); }

    @SuppressWarnings("unchecked cast")
    public static <T> EmptyCollectionHolder<T> getInstance() {
        final var instance = EmptyCollectionHolder.instance;
        if (instance != null)
            return (EmptyCollectionHolder<T>) instance;
        synchronized (EmptyCollectionHolder.class) {
            final var instance2 = EmptyCollectionHolder.instance;
            if (instance2 != null)
                return (EmptyCollectionHolder<T>) instance2;
            return (EmptyCollectionHolder<T>) (EmptyCollectionHolder.instance = new EmptyCollectionHolder<>());
        }
    }

