    @Contract(value = IF_1ST_NULL_THEN_FALSE_1, pure = true)
    @Override public boolean equals(final @Nullable Object other) {
        if (other == null)
            return false;
        if (this == other)
            return true;
        if (other instanceof CollectionHolder<?> otherConverted)
            return otherConverted.isEmpty();
        if (other instanceof MinimalistCollectionHolder<?> otherConverted)
            return otherConverted.size() == 0;
        return false;
    }

    @Contract(value = IF_1ST_NULL_THEN_FALSE_1, pure = true)
    public boolean equals(final @Nullable MinimalistCollectionHolder<?> other) {
        if (other == null)
            return false;
        if (this == other)
            return true;
        if (other instanceof CollectionHolder<?> otherConverted)
            return otherConverted.isEmpty();
        return other.size() == 0;
    }

    @Contract(value = IF_1ST_NULL_THEN_FALSE_1, pure = true)
    public boolean equals(final @Nullable CollectionHolder<?> other) {
        if (other == null)
            return false;
        if (this == other)
            return true;
        return other.isEmpty();
    }

    @Contract(value = _1ST_IS_NOT_NULL_1, pure = true) public boolean equals(final @Nullable EmptyCollectionHolder<?> other) { return other != null; }

